import React, { Component } from 'react';

class Button extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            button:true
        }
        this.handleClick = this.handleClick.bind(this);
    }

        handleClick(){
            this.setState({
                button: !this.state.button
            })
        }

        render(){
                <div className="login-button">
                if(this.state.button){
                    <button className =  "leftbuttonTrue">Login</button>
                } else
                {
                     <button className =  "leftbuttonTrue">Login</button>
                }
                
                <button className = {this.state.button ? "rightbuttonTrue": "rightbuttonFalse"}>Signup</button>
                </div>
        
        }
}

export default Button;
